        super(props);
    }

    renderLines(){
         return this.props.console.join("\n");
    }

    clearConsole(){
        this.props.console = [];
    }

    render(){
        e(
            'textarea',
            {
                className:'console',
            },
            this.renderLines()
        ),
        <Button onClick={this.clearConsole()}/>
